script: |
  super -f text -I q9660.spq | sort > q9660.out

inputs:
  - name: q9660.spq
    data: |
      SELECT ALL - 69 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT - col0 = - col0 * 79 + - col0 * + col0 + - + col1;
  - name: tab0

outputs:
  - name: q9660.out
    data: |
      -69
      -69
      -69
